import React from 'react'

function separaHora(data){
  return data.split(' ')[0]
}

const Table = ({lista}) => (
  <table>
    {lista.map((row)=>(
      <tr>
        <td key={row.name}>{row.name}</td>
        <td key={row.data.getTime()}>{row.data.toLocaleString("pt-BR").getTime()}</td>
      </tr>
    ))}
  </table>
)

export default Table
